import{_ as e,o as a,c as r,Q as t,k as i,a as o}from"./chunks/framework.1809cda4.js";const n=JSON.parse('{"title":"FHIR RESOURCES","description":"","frontmatter":{},"headers":[],"relativePath":"docs/ehr/fhir/01-fhir-resources.md","filePath":"docs/ehr/fhir/01-fhir-resources.md","lastUpdated":1697933515000}'),s={name:"docs/ehr/fhir/01-fhir-resources.md"},d=[t('<h1 id="fhir-resources" tabindex="-1">FHIR RESOURCES <a class="header-anchor" href="#fhir-resources" aria-label="Permalink to &quot;FHIR RESOURCES&quot;">​</a></h1><h2 id="common-resources" tabindex="-1">Common Resources <a class="header-anchor" href="#common-resources" aria-label="Permalink to &quot;Common Resources&quot;">​</a></h2><h3 id="documentreference" tabindex="-1">DocumentReference <a class="header-anchor" href="#documentreference" aria-label="Permalink to &quot;DocumentReference&quot;">​</a></h3><h3 id="binary" tabindex="-1">Binary <a class="header-anchor" href="#binary" aria-label="Permalink to &quot;Binary&quot;">​</a></h3><h2 id="relationships" tabindex="-1">Relationships <a class="header-anchor" href="#relationships" aria-label="Permalink to &quot;Relationships&quot;">​</a></h2><h3 id="patient-imagingstudy" tabindex="-1">Patient -- ImagingStudy <a class="header-anchor" href="#patient-imagingstudy" aria-label="Permalink to &quot;Patient -- ImagingStudy&quot;">​</a></h3><h4 id="outline-v2023-10-17" tabindex="-1">Outline v2023-10-17 <a class="header-anchor" href="#outline-v2023-10-17" aria-label="Permalink to &quot;Outline v2023-10-17&quot;">​</a></h4><p><img src="/ehr-docs/fhir/01-fhir-resources/01-imagingstudy.png" alt="image"></p><h4 id="imagingstudy-resource" tabindex="-1">ImagingStudy Resource <a class="header-anchor" href="#imagingstudy-resource" aria-label="Permalink to &quot;ImagingStudy Resource&quot;">​</a></h4><p>Look <a href="https://www.hl7.org/fhir/imagingstudy.html" target="_blank" rel="noreferrer">ImagingStudy Resource</a> on FHIR.</p><p>Representation of the content produced in a DICOM imaging stidy. A study comprises a set of series, each of which includes a set of Service-Object Pair Instances (SOP Instances - images or other data) acquired or produced in a common context. A series is of only one modality (e.g., X-ray, MR, CT, ultrasound), but a study may have multiple series of different modalities.</p><h5 id="scope-and-usage" tabindex="-1">Scope and Usage <a class="header-anchor" href="#scope-and-usage" aria-label="Permalink to &quot;Scope and Usage&quot;">​</a></h5><p>ImagingStudy provides information on a Dicom imaging study, and the series and imaging objects in that study. It also provides information on how to retrieve that information (in a native DICOM format, or in a rendered format, such as JPEG). ImagingStudy is used to make avaliable information about all parts of a single DICOM study.</p><p>This resource provides mappings of its elements to DICOM attributes. DICOM attributes are identified by a 32-bit tag, presented in canonical form as two four-digit hexadecimal values within parentheses and separated by a comma, e.g. (0008, 103E). The name and value representation (data type) of each attribute can be found in <a href="http://medical.nema.org/medical/dicom/current/output/html/part06.html" target="_blank" rel="noreferrer">DICOM Part 6 Data Dictionary</a>. The use of the attributes in the context of information objects, including detailed description of use, can be found in <a href="http://medical.nema.org/medical/dicom/current/output/html/part03.html" target="_blank" rel="noreferrer">DICOM Part 3 Information Object Definitions</a>. Attributes used in the DICOM query information models, such as <code>Number of Instances in Study</code>, can be found in <a href="http://medical.nema.org/medical/dicom/current/output/html/part04.html#chapter_C" target="_blank" rel="noreferrer">DICOM Part 4 Annex</a>.</p><p>ImagingStudy provides access to significant DICOM information but will only eliminate the need for DICOM query (e.g. QIDO-RS) in the simplest cases. The DICOM instances are not stored in the ImagingStudy resource; use of a <code>DICOM WADO-RS server</code> or other storage mechanism is needed.</p><p>An ImagingStudy SHALL reference one DICOM Study, and MAY reference a subset of that Study. More than one ImagingStudy MAY reference the same DICOM Study or different subsets of the same DICOM Study.</p><h5 id="boundaries-and-relationships" tabindex="-1">Boundaries and Relationships <a class="header-anchor" href="#boundaries-and-relationships" aria-label="Permalink to &quot;Boundaries and Relationships&quot;">​</a></h5><p>Use the ImagingStudy resource to store details of an entire DICOM Study and associated information.</p><ul><li>Use the <a href="#documentreference">DocumentReference</a> resource to store non-DICOM images, video, or aydio with relevant metadata.</li><li>Use the <a href="#binary">Binary</a> resource to store arbitrary content.</li><li>Use the <a href="#imagingselection">ImagingSelection</a> resource to store a reference to a specific set of DICOM images, frames or other DICOM instances.</li></ul><h5 id="resource-content" tabindex="-1">Resource Content <a class="header-anchor" href="#resource-content" aria-label="Permalink to &quot;Resource Content&quot;">​</a></h5><p><a href="#imagingstudy-resource-mindmap">Edit ImagingStudy MindMap</a><img src="/ehr-docs/fhir/01-fhir-resources/03-imagingstudy-resource.png" alt="image"></p><h5 id="terminology-bindings" tabindex="-1">Terminology Bindings <a class="header-anchor" href="#terminology-bindings" aria-label="Permalink to &quot;Terminology Bindings&quot;">​</a></h5><p>Have a look at <a href="https://www.hl7.org/fhir/imagingstudy.html#tx" target="_blank" rel="noreferrer">ImagingStudy Resource Terminology Bindings</a>.</p><h4 id="imagingselection-resource" tabindex="-1">ImagingSelection Resource <a class="header-anchor" href="#imagingselection-resource" aria-label="Permalink to &quot;ImagingSelection Resource&quot;">​</a></h4><h4 id="endpoint-resource" tabindex="-1">Endpoint Resource <a class="header-anchor" href="#endpoint-resource" aria-label="Permalink to &quot;Endpoint Resource&quot;">​</a></h4><p>Look <a href="https://www.hl7.org/fhir/endpoint.html" target="_blank" rel="noreferrer">Endpoint Resource</a> on FHIR.</p><p>The technical details of an endpoint that can be used for electronic services, such as for web services providing XDS.b, a REST endpoint for another FHIR server, or a s/Mime email address. This may include any security context inofrmation.</p><h5 id="scope-and-usage-1" tabindex="-1">Scope and Usage <a class="header-anchor" href="#scope-and-usage-1" aria-label="Permalink to &quot;Scope and Usage&quot;">​</a></h5><p>An endpoint describe the technical details of a location that can be connected to for the delivery/retrieval of information. In this part, the <code>Endpoint Resource</code> is used to store <code>Orthanc Pan server</code> information for ImagingStudy resopurce. Allow user can get the raw DICOM data from ImagingStudy endpoint attribute.</p><ul><li>DICOM/imaging: Location of where to query, retrieve or store imaging content and metadata (QIDO-RS, WADO-RS, WADO-URI, STOW-RS).</li></ul><p><img src="/ehr-docs/fhir/01-fhir-resources/02-endpoint-resource.png" alt="image"></p><h4 id="q-a-for-dicom-study" tabindex="-1">Q&amp;A for Dicom study <a class="header-anchor" href="#q-a-for-dicom-study" aria-label="Permalink to &quot;Q&amp;A for Dicom study&quot;">​</a></h4><ul><li>Q1: What is a Dicom study? Is it a subject folder in a SPARC dataset?</li><li>Q2: What are Dicom series? Are they sample folders in a SPARC dataset subject folder?</li><li>Q3: What are instances? Are they dicom files in a SPARC dataset sample folder?</li></ul><h3 id="edit-mindmap" tabindex="-1">Edit MindMap <a class="header-anchor" href="#edit-mindmap" aria-label="Permalink to &quot;Edit MindMap&quot;">​</a></h3><h4 id="imagingstudy-resource-mindmap" tabindex="-1">ImagingStudy Resource MindMap <a class="header-anchor" href="#imagingstudy-resource-mindmap" aria-label="Permalink to &quot;ImagingStudy Resource MindMap&quot;">​</a></h4>',35),i("iframe",{style:{border:"1px solid rgba(0, 0, 0, 0.1)"},sandbox:"allow-scripts allow-popups allow-forms allow-modals allow-same-origin",width:"100%",height:"450",src:"https://boardmix.cn/app/share/CAE.CJq_sA0gASoQmCDoLmCtoQET8F8m5ZSH1TAGQAE/jWFwHv",allowfullscreen:""},null,-1),i("h4",{id:"endpoint-resource-mindmap",tabindex:"-1"},[o("Endpoint Resource MindMap "),i("a",{class:"header-anchor",href:"#endpoint-resource-mindmap","aria-label":'Permalink to "Endpoint Resource MindMap"'},"​")],-1),i("iframe",{style:{border:"1px solid rgba(0, 0, 0, 0.1)"},sandbox:"allow-scripts allow-popups allow-forms allow-modals allow-same-origin",width:"100%",height:"450",src:"https://boardmix.cn/app/share/CAE.CJq_sA0gASoQPIxAsCLNWgF419R7024RNzAGQAE/jWFwHv",allowfullscreen:""},null,-1)];const l=e(s,[["render",function(e,t,i,o,n,s){return a(),r("div",null,d)}]]);export{n as __pageData,l as default};
